import './NewTask.css';
import React, { useState } from 'react';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

const NewTask = (props) => {
    const [piority, setPiority] = useState('Normal');

    const handleChange = (event) => {
        setPiority(event.target.value);
    };

    return (
        <div className="container">
            <Typography>New Task</Typography>
            <TextField id="outlined-basic" placeholder="Add new task" variant="outlined"/>
            <div className="description">
                <Typography>Description</Typography>
                <textarea className="text-description"/>
            </div>
            <div className="option">
                <FormControl variant="outlined" className="date-time">
                    <Select
                        value={piority}
                        onChange={handleChange}
                    >
                        <MenuItem value={'Low'}>Low</MenuItem>
                        <MenuItem value={'Normal'}>Normal</MenuItem>
                        <MenuItem value={'High'}>High</MenuItem>
                    </Select>
                </FormControl>
                <FormControl variant="outlined" className="piority">
                    <Select
                        labelId="demo-simple-select-outlined-label"
                        id="demo-simple-select-outlined"
                        value={piority}
                        onChange={handleChange}
                        label="Age"
                    >
                        <MenuItem value="">
                            <em>None</em>
                        </MenuItem>
                        <MenuItem value={10}>Ten</MenuItem>
                        <MenuItem value={20}>Twenty</MenuItem>
                        <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                </FormControl>

            </div>

            <Button variant="outlined" className="btn-add">Add</Button>

        </div>
    );
};

export default NewTask;
